import React, { useState, useEffect } from "react";
import axios from "axios";
import "../App.css";

const UserSurveyDetails = () => {
  const [mobileNumber, setMobileNumber] = useState("");
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);

  // Fetch all user data on load
  const fetchAllData = async () => {
    setLoading(true);
    try {
      const response = await axios.get(
        "https://babralaapi-d3fpaphrckejgdd5.centralindia-01.azurewebsites.net/auth/getAllUsersWithRoles"
      );
      if (response.data) {
        setData(response.data);
      } else {
        alert("No data found.");
      }
    } catch (error) {
      console.error("Error fetching all data:", error);
      alert("An error occurred while fetching all data.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchAllData();
  }, []);

  // Search by Mobile Number
  

  return (
    <div className="user-survey-container">
        <div className="user-survey-search"> 
            <h1>User Survey Details</h1>
            <div className="user-survey-search-bar">
              <input
                type="text"
                placeholder="Enter Mobile Number"
                value={mobileNumber}
                onChange={(e) => setMobileNumber(e.target.value)}
              />
              <button onClick={handleSearch} disabled={loading}>
                {loading ? "Searching..." : "Search"}
              </button>
            </div>
        </div>     

        <div className="user-survey-table-container">
                <table>
                  <thead>
                    <tr>
                      <th>First Name</th>
                      <th>Mobile</th>
                      <th>Age</th>
                      <th>DOB</th>
                      <th>Gender</th>
                      <th>Email</th>
                      <th>Created By</th>
                      <th>Modified By</th>
                    </tr>
                  </thead>
                  <tbody>
                    {data.length > 0 ? (
                      data.map((owner, index) => (
                        <tr key={index}>
                          <td>{owner.owner.FirstName || "N/A"}</td>
                          <td>{owner.owner.MobileNumber || "N/A"}</td>
                          <td>{owner.owner.Age || "N/A"}</td>
                          <td>{owner.owner.DOB || "N/A"}</td>
                          <td>{owner.owner.Gender || "N/A"}</td>
                          <td>{owner.owner.Email || "N/A"}</td>
                          <td>{owner.owner.CreatedBy || "N/A"}</td>
                          <td>{owner.owner.UserModifiedBy || "N/A"}</td>
                        </tr>
                      ))
                    ) : (
                      <tr>
                        <td colSpan="17" className="user-survey-no-data">
                          No data available
                        </td>
                      </tr>
                    )}
                  </tbody>
                </table>
        </div>
    </div>
  );
};

export default UserSurveyDetails;
